  return (
    <IonPage>
      <IonHeader>
        <IonToolbar>
          <IonTitle>CAMERA APP</IonTitle>
        </IonToolbar>
      </IonHeader>
      {/* Modified IonContent to add 16px Padding */}
      <IonContent fullscreen className="ion-padding">

        <div>BASIC CAMERA APP</div>

      </IonContent>
    </IonPage>
  );
};

export default Home;
